import * as types from "../../actionTypes";
import Lu_EmployeesApi from "../../../api/Lu_EmployeesApi";

let actionsFunction = {

  //CRUD METHODS

  // Create lu_employees
  createLu_Employees: function(lu_employees) {
    return function(dispatch) {
      return Lu_EmployeesApi
        .createLu_Employees(lu_employees)
        .then(lu_employees => {
          dispatch(actionsFunction.createLu_EmployeesSuccess(lu_employees));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  createLu_EmployeesSuccess: function(lu_employees) {
    return { type: types.CREATE_LU_EMPLOYEES_SUCCESS, payload: lu_employees };
  },


  // Delete lu_employees
  deleteLu_Employees: function(id) {
    return function(dispatch) {
      return Lu_EmployeesApi
        .deleteLu_Employees(id)
        .then(lu_employees => {
          dispatch(actionsFunction.deleteLu_EmployeesSuccess(lu_employees));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  deleteLu_EmployeesSuccess: function(lu_employees) {
    return { type: types.DELETE_LU_EMPLOYEES_SUCCESS, payload: lu_employees };
  },


  // Get lu_employees
  loadLu_Employees: function(id) {
    return function(dispatch) {
      return Lu_EmployeesApi
        .getOneLu_Employees(id)
        .then(lu_employees => {
          dispatch(actionsFunction.loadLu_EmployeesSuccess(lu_employees));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  loadLu_EmployeesSuccess: function(lu_employees) {
    return { type: types.GET_LU_EMPLOYEES_SUCCESS, payload: lu_employees };
  },

  // Load  list
  loadLu_EmployeesList: function() {
    return function(dispatch) {
      return Lu_EmployeesApi
        .getLu_EmployeesList()
        .then(list => {
          dispatch(actionsFunction.loadLu_EmployeesListSuccess(list));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  loadLu_EmployeesListSuccess: function(list) {
    return { type: types.LIST_LU_EMPLOYEES_SUCCESS, payload: list };
  },

	
  // Save lu_employees
  saveLu_Employees: function(lu_employees) {
    return function(dispatch) {
      return Lu_EmployeesApi
        .saveLu_Employees(lu_employees)
        .then(lu_employees => {
          dispatch(actionsFunction.saveLu_EmployeesSuccess(lu_employees));
        })
        .catch(error => {
          throw error;
        });
    };
  },

  saveLu_EmployeesSuccess: function(lu_employees) {
    return { type: types.UPDATE_LU_EMPLOYEES_SUCCESS, payload: lu_employees };
  },


};

export default actionsFunction;
